To a survivor of any trauma, change can feel unsafe. How can we sleep with uncertainty lurking in the corners of our minds? Where do we find peace and the comfort of in a safe space?‚Å£
‚Å£
When we are silent, even for a moment, draw in a deep breath with eyes closed, then exhale gently, slowly, deliberately; we find our center‚Äîa safe space within us where we find Love in silence.‚Å£
‚Å£
The place inside us that craves our attention. We can appreciate the moment in silence as we release all worry, anxiety, and doubt. Strength is drawn from a place deep within to face changes. We meet them not as a survivor in those challenging moments but as a Spirit Warrior.‚Å£
‚Å£
External and internal changes are hard enough to make for someone without a traumatic event in their life; however, many survivors of sexual assault have developed unhealthy coping mechanisms or habits that, when triggered, we might feel off balance.‚Å£
‚Å£
Recently, my awareness showed me there were feelings of being off-balance again. Feelings of uncertainty and self-doubts were noticeably creeping their way in through the doors of my mind. I was questioning everything I said or did. My response to myself was "WTF?"‚Å£
‚Å£
It was time for a quick inventory of all the feelings. The results revealed my current emotions were all old messages from my past; my inner critics trying to keep me safe as changes in location and a way of life begin. Self-regulation tools of deep breaths (as many as I need in a day), journaling (even if it's just a thought or two), reaching out to a trusted friend in total authenticity, and grounding are my best tools to use in silencing my inner critics. There is one other tool I regularly use: self-validation of my worth.‚Å£
‚Å£
When you read the statement, "I Am Enough/More." what do you really think it means?‚Å£
‚Å£
For me, it's saying I am more than my story. I am not the trauma that happened, nor do the old habits define me. The me of now is not the me of then.‚Å£ I Am:‚Å£
‚Å£
more than my past.‚Å£
more than my feelings and thoughts.‚Å£
capable.‚Å£
bold and strong.‚Å£
safe.‚Å£
loved.‚Å£
‚Å£
Grow with Love,‚Å£
